import React, { useState } from "react";
import axios from "axios";

function App() {
  const [file, setFile] = useState(null);
  const [transactions, setTransactions] = useState([]);
  const [isLoading, setIsLoading] = useState(false);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleExtract = async () => {
    if (!file) return alert("Please upload a file!");
    const formData = new FormData();
    formData.append("file", file);

    try {
      setIsLoading(true);
      const response = await axios.post("http://localhost:8000/extract-pdf", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      setIsLoading(false);
      setTransactions(response.data.data || []);
    } catch (error) {
      setIsLoading(false);
      console.error(error);
      alert("Failed to extract data from the PDF");
    }
  };

  const handleInputChange = (index, field, value) => {
    const updatedTransactions = [...transactions];
    updatedTransactions[index][field] = value;
    setTransactions(updatedTransactions);
  };

  const handleSubmit = async () => {
    try {
      const response = await axios.post("http://localhost:8000/analyze-transactions", transactions, {
        headers: { "Content-Type": "application/json" },
      });
      alert("Transactions submitted successfully!");
      console.log(response.data);
    } catch (error) {
      console.error(error);
      alert("Failed to submit transactions.");
    }
  };

  return (
    <div>
      <h1>Bank Statement Processing</h1>

      <input type="file" onChange={handleFileChange} accept=".pdf" />
      <button onClick={handleExtract} disabled={isLoading}>
        {isLoading ? "Extracting..." : "Extract Transactions"}
      </button>

      {transactions.length > 0 && (
        <div>
          <h2>Edit Transactions</h2>
          <table border="1">
            <thead>
              <tr>
                <th>Date</th>
                <th>Description</th>
                <th>Credit</th>
                <th>Debit</th>
                <th>Balance</th>
              </tr>
            </thead>
            <tbody>
              {transactions.map((txn, idx) => (
                <tr key={idx}>
                  <td>
                    <input
                      type="text"
                      value={txn.date}
                      onChange={(e) => handleInputChange(idx, "date", e.target.value)}
                    />
                  </td>
                  <td>
                    <input
                      type="text"
                      value={txn.description}
                      onChange={(e) => handleInputChange(idx, "description", e.target.value)}
                    />
                  </td>
                  <td>
                    <input
                      type="number"
                      value={txn.credit}
                      onChange={(e) => handleInputChange(idx, "credit", e.target.value)}
                    />
                  </td>
                  <td>
                    <input
                      type="number"
                      value={txn.debit}
                      onChange={(e) => handleInputChange(idx, "debit", e.target.value)}
                    />
                  </td>
                  <td>
                    <input
                      type="number"
                      value={txn.balance}
                      onChange={(e) => handleInputChange(idx, "balance", e.target.value)}
                    />
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
          <button onClick={handleSubmit}>Submit Transactions</button>
        </div>
      )}
    </div>
  );
}

export default App;
